// function to find the length of longest increasing subsequence in an array
function f_gold(nums) {
    let n = nums.length;
    let f = 1; // current length of increasing subsequence
    let res = f; // length of longest increasing subsequence
    for (let i = 1; i < n; i++) {
        f = 1 + (nums[i - 1] < nums[i] ? f : 0); // update f based on whether nums[i] is greater than nums[i-1]
        res = Math.max(res, f); // update res if f is greater than res
    }
    return res; // return the length of longest increasing subsequence
}
